import React from 'react';
import './App.css';
import Nav from './Nav';
import About from './About';
import Shop from './Shop';
import 'react-router-dom';


function App() {

  return(
    <div className="app">
      <Nav />
      <About />
      <Shop />
    </div>
  );
};


export default App;
